import React from 'react';
import '../../styles/resume.css';
import MyResume from '../../assets/Coby Walsh Resume.pdf';

const styles = {
  resumeStyle: {
    background: 'red',
  },
  ResumeStyle: {
    fontSize: '100px',
  },
};

function resume() {
  const handleDownloadResume = () => {
    const anchor = document.createElement('a');
    anchor.href = MyResume; 
    anchor.download = 'Coby Walsh Resume.pdf'; 
    anchor.click();
  };
  return (
    <div style={styles.resumeStyle} id="myResume" className="resume">
    <h1 style={styles.ResumeStyle}>Resume</h1>
    <p></p>
    <button onClick={handleDownloadResume}>Download Resume</button>
  </div>
  );
}

export default resume;
